import { Button, DoubleButton } from "./Button";

export function Input({ value,type, onChange }) {
  return (
    <input value={value}type={type} onChange={onChange} />
  );
}

export function InputWithButton({ type, value, onChange,onClick0,onClick1 }) {

return (
    <div>
        <Input type={type} value={value} onChange={onChange} />
        <DoubleButton  event0='add' event1='delete' handler0={onClick0} handler1={onClick1}/>
    </div>
  );
}
